import ProductCard from "../components/ProductCard";
import { useSelector, useDispatch } from "react-redux";
import CentralAppLayout from "../components/CentralAppLayout";
import NavibarLayout from "../components/NavibarLayout";
import { ADD_QUANTITY_SUCCESS } from "../reducers/products";

const Index = () => {
  // const { products } = useSelector((state) => state.products);
  const dispatch = useDispatch();
  const onStateChange = () => {
    dispatch({
      type: ADD_QUANTITY_SUCCESS,
    });
  };
  return (
    <>
      <CentralAppLayout>
        <NavibarLayout>
          <button onClick={onStateChange}>버튼</button>
          {products &&
            products.map((product) => {
              return (
                <ProductCard
                  key={product.id}
                  id={product.id}
                  title={product.title}
                  price={product.price}
                  quantity={product.quantity}
                  cover={product.cover}
                />
              );
            })}
        </NavibarLayout>
      </CentralAppLayout>
    </>
  );
};

export default Index;
